import React from 'react';
import styled from 'styled-components'

const A = styled.a ` 
font-family: 'Montserrat', sans-serif;
`

const Headwrapper = styled.div `

background: #2A2F36;
width: 100%
height: 90px;
color: ::-webkit-search-results-decoration;
`

const Div = styled.div`
margin: 0px;

`

const Nav = styled.nav`
position: absolute;
top: 50%; right:15px;


`

function Header() {
  return (
        <Headwrapper>

            <Div>
                LOGO
            </Div>

            <Nav>
                <ul>
                    <li>
                        <A href = "#">Hem</A>
                    </li>
                </ul>
            </Nav>





        </Headwrapper>
  );
}

export default Header;
